script: |
  super -f text -I q3428.spq | sort > q3428.out

inputs:
  - name: q3428.spq
    data: |
      SELECT DISTINCT col0 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - - 30 + + col2 * + + col1 * - col0 > + 91 * - col0;
  - name: tab1

outputs:
  - name: q3428.out
    data: |
      51
      85
      91
